import axios from 'axios'


class MarketsContainer extends Component{

  constructor(props) {
    super();

      this.state = {
        crypto: []
      };

}

  _getTickerBySymbol(data) {
        let ticker = {}
        data.forEach(item => {
            let symbol = item.symbol || item.s;
            ticker[symbol] = {
                symbol: symbol,
                lastPrice: item.lastPrice || item.c,
                priceChange: item.priceChange || item.p,
                priceChangePercent: item.priceChangePercent || item.P,
                highPrice: item.highPrice || item.h,
                lowPrice: item.lowPrice || item.l,
                quoteVolume: item.quoteVolume || item.q,
            }
        })
        return ticker;

    }


componentDidMount(props){

  axios.get('https://api.binance.com/api/v1/exchangeInfo' )

        .then((response) => response.json()) 
        .then((responseJson) => {
          if(responseJson === undefined ){
            this.setState( {
              searching: 'errorrrrr',
              resfreshing: false
            })
          }else {
            this.setState({ resfreshing: false, searching: 'se consiguio' })
          }
        })

        .catch( error => {
          console.log(error)
        })

}


  render(){
    return(
      <div>

      </div>
    )
  }
}

export default MarketsContainer;
